import { useFetch } from '../../hooks/useFetch'

export default function CardContainer(props) {
  const { loading, data } = useFetch(props.url)
  const pokemon = data

  return (
    <>
      <div className='card' onClick={() => window.open(props.url, '_blank')} style={{
        width: 300,
        height: 400,
        background: props.color,
        textDecoration: 'none',
        color: 'black'
      }}>

      </div>
    </>
  )
}
